    public static void arraySum(){
        Scanner sc = new Scanner(System.in);
        int n = sc.nextInt();
        int result = 0;
        while(sc.hasNextInt()){
            result = result + sc.nextInt();
        }
        System.out.print(result);
    }

    public static void checkPangram(){
        Scanner in = new Scanner(System.in);
        Set<String> set = new HashSet<String>();

        while(in.hasNext()){

            String s = in.next();
            //System.out.println("checking "+s);
            for(int i = 0; i < s.length(); i++){
                char c = s.charAt(i);
                System.out.println("at char: "+c);
                if(Character.isLetter(c)){
                    set.add(Character.toString(c).toLowerCase());
                    System.out.println("added: "+c);
                }

                if(set.size() == 26){
                    System.out.println("pangram"+set.toString());
                    in.close();
                    return;
                }
                //System.out.println("hasNext=" + in.hasNext());
            }

        }
        in.close();
        System.out.println("not pangram" + set.toString());

    }
